        function getKey2Comb()
        {
            //debugger;

            var comb_key2obj = {};

            var active_combinations = main_item.active_combinations;

            for(var j in active_combinations)
            {
                if (!active_combinations.hasOwnProperty(j))
                {
                    continue;
                }

                var cs = active_combinations[j];

                var cfg = {};
                //var cfg_name = {};

                for(var i=0; i < cs.combination.length; i++)
                {
                    var c = cs.combination[i];

                    if (c.attribute_option_id)
                    {
                        cfg[c.attribute_id] = c.attribute_option_id;
                    }
                }

                //console.log('cfg', cfg);

                var comb_key = encodeKey(cfg);

                //console.log('comb_key', comb_key);

                comb_key2obj[comb_key] = cs;

            }

            return comb_key2obj;
        }

        function encodeKey(obj)
        {
            //console.log('encodeKey', obj);

            obj = sortKeys(obj);
            var keys = Object.keys(obj)

            var opts = [];

            for (var i = 0; i < keys.length; i++)
            {
                var k = keys[i];
                var v = obj[k];
                var opt_txt = k + "-" + v;
                opts.push(opt_txt);
            }

            var var_key = opts.join(".");

            //console.log('var_key', var_key);

            return var_key;
        }


        function getCurrentCombKey()
        {
            var cfg = {};

            var $selects = $("[data-ext-opts-box] select[ext-opts]");
            $selects.each(function(k,el)
            {
                var $sel = $(el);

                var opt_id = $sel.attr('data-attribute-id');
                var opt_val_id = $sel.find("option:selected").attr('data-option-id');

                cfg[opt_id] = opt_val_id;

            });

            var $radio_input = $("input[type=radio][ext-opts]:checked");
            $radio_input.each(function(k,el)
            {
                var $el = $(el);

                var opt_id = $el.attr('data-attribute-id');
                var opt_val_id = $el.attr('data-option-id');

                cfg[opt_id] = opt_val_id;
            });


            var comb_key = encodeKey(cfg);

            return comb_key;
        }


        function sortKeys(obj_1)
        {
            var key = Object.keys(obj_1)
                .sort(function order(key1, key2) {
                    if (key1 < key2) return -1;
                    else if (key1 > key2) return +1;
                    else return 0;
                });

            // Taking the object in 'temp' object
            // and deleting the original object.
            var temp = {};

            for (var i = 0; i < key.length; i++)
            {
                temp[key[i]] = obj_1[key[i]];
                delete obj_1[key[i]];
            }

            // Copying the object from 'temp' to
            // 'original object'.
            for (var i = 0; i < key.length; i++)
            {
                obj_1[key[i]] = temp[key[i]];
            }

            return obj_1;
        }

