        function getInputValueForDetails(box_id, attr)
        {
            //var $input = $('[data-attribute-id-uniq="' + attr.ext.id_uniq +'"]');
            //var sel = '[data-path-box="' + box_id + '"] [data-ext-opts-path="' + attr.ext.path +'"]';

            var sel = '[data-path-box="' + box_id + '"] [data-attribute-id="' + attr.id +'"]';
            var $input = $(sel);

            if (0 == $input.length)
            {
                console.log("Can't find input by selector: " + sel);
                return '';
            }

            //console.log('getInputValueForDetails', sel, $input);

            var val = null;

            switch (attr.type)
            {
                case 'list':
                case 'UploadFont':

                    if ($input.attr('data-hide'))
                    {
                        return '';
                    }

                    var $opt = $input.find('option:selected');
                    val = $opt.text();
                    var dn = $opt.attr('data-name');
                    if (dn)
                    {
                        val = dn;
                    }

                    break;

                case 'text':
                    val = $input.val();
                    break;

                case 'color':
                case 'image':
                    var $opt = $input.find('option:checked,input:checked');
                    //console.log($opt);
                    val = $opt.attr('data-label-text');
                    break;
            }

            return val.trim();
        }

        function prepareNames(attrs, naming_cfg, level, base_path_box)
        {

            if (typeof base_path_box == "undefined")
            {
                base_path_box = '';
            }

            if (typeof level == "undefined")
            {
                level = 1;
            }

            var nested_initial = naming_cfg.nested;

            //console.log('naming_cfg');
            //console.log(naming_cfg);

            var res = [];

            var fmt = {};

            fmt.item_name_prefix = "\n";
            fmt.item_name_suffix = "";
            fmt.item_name_attrs_separator = " ";

            fmt.item_attrs_prefix = "";
            fmt.item_attrs_suffix = "";

            fmt.attr_row_prefix = "";
            fmt.attr_row_suffix = "";

            fmt.attr_name_prefix = "";
            if (naming_cfg.nested)
            {
                fmt.attr_name_prefix = "- ";
            }
            fmt.attr_name_suffix = "";

            fmt.attr_value_prefix = "";
            fmt.attr_value_suffix = "";

            fmt.lines_separator = ", ";

            if (naming_cfg.mode_markup)
            {
                fmt.item_name_prefix = "\n'";
                fmt.item_name_suffix = "'";
                fmt.item_name_attrs_separator = ":\n";
                fmt.lines_separator = ", ";
            }

            if (naming_cfg.mode_html)
            {
                fmt.item_name_prefix = '<br><b>';
                fmt.item_name_suffix = ':</b>';

                fmt.item_name_attrs_separator = "<br>";

                fmt.attr_name_prefix = '<b>' + fmt.attr_name_prefix;

                fmt.attr_name_suffix = fmt.attr_name_suffix + '</b>';

                fmt.lines_separator = '<br>' + "\n";
            }

            if (naming_cfg.mode_nested_short)
            {
                fmt.item_attrs_prefix = "(";
                fmt.item_attrs_suffix = ")";

                if (naming_cfg.nested)
                {
                    fmt.lines_separator = ", ";
                }
            }

            if (naming_cfg.mode_text_full || naming_cfg.mode_markup)
            {
                fmt.lines_separator = "\n";
            }

            if (naming_cfg.fmt)
            {
                fmt = $.extend(true, fmt, naming_cfg.fmt);
            }

            if (naming_cfg.nested && naming_cfg.fmt_nested)
            {
                fmt = $.extend(true, fmt, naming_cfg.fmt_nested);
            }

            for(var position=0; position<attrs.length; position++)
            {
                var attr = attrs[position];

                if (attr.type == 'item')
                {
                    var opt = attr.options[0].item;

                    if (!opt.SKU)
                    {
                        console.log('Attribute has type = item, but SKU was not provided');
                        console.log(opt);
                        continue;
                    }

                    var nested_sku = opt.SKU;
                    var nested_item = api_data[nested_sku];

                    //res.push(fmt_item_name_prefix + attr.name + fmt_item_name_suffix);

                    if (nested_item)
                    {
                        naming_cfg.nested = true;

                        var path_new = base_path_box;
                        if (path_new)
                        {
                            path_new += '.';
                        }
                        path_new += attr.id;
                        path_new += '-' + attr.options[0].id;
                        path_new += '-' + attr.options[0].item.id;

                        //naming_cfg.path_box = path_new;

                        var nested_names = prepareNames(nested_item.attributes, naming_cfg, level+1, path_new);
                        var line = fmt.item_attrs_prefix + nested_names + fmt.item_attrs_suffix;

                        if ('' == nested_names)
                        {
                            line = '';
                        }

                        var line_full = fmt.item_name_prefix + attr.name + fmt.item_name_suffix;

                        if (line)
                        {
                            line_full += fmt.item_name_attrs_separator + line;
                        }

                        res.push(line_full);
                    }
                    else
                    {
                        console.log('Attribute has type = item, but there are no data for this SKU: `' + opt.sku + '`');
                        continue;
                    }
                }
                else
                {
                    var name = attr.name;
                    var line = "";
                    var val = getInputValueForDetails(base_path_box, attr);

                    if (naming_cfg.nested && naming_cfg.mode_nested_short)
                    {
                        line = val;
                    }
                    else
                    {

                        line += fmt.attr_row_prefix;

                        line += fmt.attr_name_prefix;
                        line += name;
                        line += fmt.attr_name_suffix;

                        line += ": ";

                        line += fmt.attr_value_prefix;
                        line += val;
                        line += fmt.attr_value_suffix;

                        line += fmt.attr_row_suffix;
                    }

                    if (val)
                    {
                        res.push(line);
                    }

                }

            }

            res = res.join(fmt.lines_separator);

            naming_cfg.level = level;

            if (get_url_param("details_cfg"))
            {
                res = "<br><b>" + JSON.stringify(naming_cfg) + "</b><br> " + JSON.stringify(fmt) + "<br><div data-item-details-test class='card card-body bg-light' style='margin: 10px 0px; display: block'>" + res + "</div>";
            }

            return res;

        }



        function getInputValueForSerialize($input)
        {
            var path = $input.attr('data-path');
            var type = $input.attr('data-input-type');

            var val;

            switch(type)
            {
                case 'list':
                case 'UploadFont':
                    val = $input.find('option:selected').val();
                    break;

                case 'text':
                    val = $input.val();
                    val = replaceAll('*', '&ast;', val);
                    break;

                case 'color':
                case 'image':
                    val = $input.find('option:checked').attr('data-label-text');
                    val = replaceAll('*', '&ast;', val);
                    break;
            }

            return val;
        }


