        function extOptsMobileAppFunctionCheck(f)
        {
            if (!window['PlobalBridge'])
            {
                console.log('extOptsMobileAppFunctionCheck', 'No PlobalBridge');
                return;
            }

            var pb = window['PlobalBridge'];

            if (!pb[f])
            {
                console.log('extOptsMobileAppFunctionCheck', 'No `' + f + '` in PlobalBridge');
                return false;
            }

            if (typeof pb[f] !== 'function')
            {
                console.log('extOptsMobileAppFunctionCheck', '`' + f + '` in PlobalBridge exists, but is not function');
                return false;
            }

            return true;
        }

        function extOptsMobileAppSetLineItemProperties(props)
        {

            if (!extOptsMobileAppFunctionCheck('addLineItemProperty'))
            {
                return;
            }

            if (!extOptsMobileAppFunctionCheck('removeLineItemProperty'))
            {
                return;
            }

            for(var key in props)
            {
                if (!props.hasOwnProperty(key))
                {
                    continue;
                }

                var value = props[key];

                var obj = {};
                obj[key] = value;

                //Do mobile handling here
                //window.PlobalBridge.addLineItemProperty({"Color":"red"}) ;
                //window.PlobalBridge.addLineItemProperty({"Letter":"A"}) ;
                //we can add all rest required properties like this individually

                var pb = window['PlobalBridge'];
                pb.removeLineItemProperty(key);
                pb.addLineItemProperty(obj);

            }

        }

