        function valueError(v, rules)
        {
            if (!rules)
            {
                return '';
            }

            if (v)
            {
                v = v.trim();
            }

            if (rules.required)
            {
                if (!v)
                {

                    if (rules.name)
                    {
                        var err = "Please select " + rules.name;
                        return err;
                    }

                    var err = "Please specify some value";
                    return err;
                }
            }

            if (rules.list)
            {
                return;
            }

            if ("only_numbers" == rules.type || "numbers_only" == rules.type)
            {
                if (rules.special_chars)
                {
                    return;
                }

                var isnum = /^\d+$/.test(v);

                if (!isnum)
                {
                    var err = "Please use only numbers";
                    return err;
                }
            }

            if ("only_text" == rules.type || "text_only" == rules.type)
            {
                var reg_exp = /^[a-zA-Z]+$/;
                var no_other_chars = (reg_exp.test(v));

                if (!no_other_chars)
                {
                    var err = "Please use only a-z, A-Z letters";
                    return err;
                }

            }

            if (v.indexOf('"') != -1)
            {
                var err = "Please don't use quotes (\")" ;
                return err;
            }

            if (v.indexOf("'") != -1)
            {
                var err = "Please don't use quotes (')" ;
                return err;
            }


            if ("alphanumeric" == rules.type && !rules.special_chars)
            {
                var reg_exp = /^[0-9a-zA-Z]+$/;
                var no_special_chars = (reg_exp.test(v));

                if (!no_special_chars)
                {
                    var err = "Please use only alphanumeric symbols";
                    return err;
                }

            }

            if (rules.min_chars && rules.max_chars && rules.min_chars == rules.max_chars)
            {
                if (v.length != rules.min_chars)
                {
                    var err = "Please specify " + rules.min_chars + " symbols";
                    return err;
                }
            }
            else
            {

                if (rules.min_chars)
                {
                    if (v.length < rules.min_chars)
                    {
                        var err = "Please use " + rules.min_chars + " symbols or more";
                        return err;
                    }
                }

                if (rules.max_chars)
                {
                    if (v.length > rules.max_chars)
                    {
                        var err = "Please use " + rules.max_chars + " symbols or less";
                        return err;
                    }
                }
            }

            if (!rules.emojis)
            {
                //console.log('chk emojis', v);

                //var reg_exp = /([\uE000-\uF8FF]|\uD83C[\uDC00-\uDFFF]|\uD83D[\uDC00-\uDFFF]|[\u2694-\u2697]|\uD83E[\uDD10-\uDD5D])/g;
                var reg_exp = /(?:[\u2700-\u27bf]|(?:\ud83c[\udde6-\uddff]){2}|[\ud800-\udbff][\udc00-\udfff]|[\u0023-\u0039]\ufe0f?\u20e3|\u3299|\u3297|\u303d|\u3030|\u24c2|\ud83c[\udd70-\udd71]|\ud83c[\udd7e-\udd7f]|\ud83c\udd8e|\ud83c[\udd91-\udd9a]|\ud83c[\udde6-\uddff]|\ud83c[\ude01-\ude02]|\ud83c\ude1a|\ud83c\ude2f|\ud83c[\ude32-\ude3a]|\ud83c[\ude50-\ude51]|\u203c|\u2049|[\u25aa-\u25ab]|\u25b6|\u25c0|[\u25fb-\u25fe]|\u00a9|\u00ae|\u2122|\u2139|\ud83c\udc04|[\u2600-\u26FF]|\u2b05|\u2b06|\u2b07|\u2b1b|\u2b1c|\u2b50|\u2b55|\u231a|\u231b|\u2328|\u23cf|[\u23e9-\u23f3]|[\u23f8-\u23fa]|\ud83c\udccf|\u2934|\u2935|[\u2190-\u21ff])/g;


                if ((reg_exp.test(v)))
                {
                    var err = "Please don't use emoji";
                    return err;
                }
            }

            if (!rules.special_chars)
            {
                //console.log('chk special_chars', v);

                var reg_exp = /^[0-9a-zA-Z]+$/;
                var no_special_chars = (reg_exp.test(v));

                if (!no_special_chars)
                {
                    var err = "Please use only alphanumeric symbols";
                    return err;
                }
            }


            return null;

        }


        function valueHint(attr)
        {

            var rules = attr.validation
            var hints = [];

            if (rules.required)
            {
                hints.push("required");
            }

            if ('text' == attr.type)
            {

                if (rules.min_chars && rules.min_chars > 1)
                {
                    hints.push(rules.min_chars + " symbols minimum");
                }

                if (rules.max_chars)
                {
                    hints.push(rules.max_chars + " symbols maximum");
                }

                if ("only_text" == rules.type || "text_only" == rules.type)
                {
                    hints.push("only a-z, A-Z letters are allowed");
                }
                else if ("numbers_only" == rules.type || "only_numbers" == rules.type)
                {
                    if (rules.special_chars)
                    {
                        hints.push("numbers and special symbols are allowed");
                    }
                    else
                    {
                        hints.push("only numbers are allowed");
                    }
                }
                else if (!rules.special_chars && 'alphanumeric' == rules.type)
                {
                    hints.push("only alphanumeric symbols are allowed");
                }
                else
                {
                    if (attr.type == 'text')
                    {

                        if (!rules.emojis)
                        {
                            hints.push("alphanumeric and special symbols are allowed (except emojis)");
                        }
                        else
                        {
                            hints.push("alphanumeric, special symbols, emojis are allowed");
                        }

                    }
                }
            }

            //console.log("hints", hints);

            var hint = '';
            if (hints.length > 0)
            {
                hint = "<ul><li>" + hints.join('</li><li>') + "</li></ul>";
            }

            return hint;
        }

        function addInputText(attr, id, input_id)
        {
            var $input = $('<input/>');
            $input.attr('type', 'text');

            addValidationCode($input, attr);

            return $input;
        }


        function addValidationCode($input, attr)
        {
            if (!attr.validation)
            {
                return;
            }

            var id = attr.ext.path;

            attr_checks[id] = {};

            attr_checks[id]['path'] = attr.ext.path;
            //attr_checks[id]['input'] = $input;
            //attr_checks[id]['input_id'] = input_id;
            attr_checks[id]['rules'] = attr.validation;

            attr_checks[id]['func'] = function($el, rules)
            {

                $el.removeAttr('data-error');
                var $div = $el.closest('div');
                $div.removeClass('ext-opts-error');

                var $msg = $div.find('.ext-opts-validation-message');
                $msg.hide();

                //console.log("Validate input", $el);

                if ($el.length == 0)
                {
                    //debugger;
                    console.log("can't get val for input");
                    console.log($el);
                }

                var v = $el.val();



                if (v)
                {
                    v = v.trim();
                }

                var err = valueError(v, rules);

                if (err)
                {
                    //console.log(err);
                    $msg.text(err);
                    $msg.show();
                    $div.addClass('ext-opts-error');
                    $el.attr('data-error', true);
                }
            }
        }

        function getAvailableOptions(attr, prev_selected)
        {
            //console.log('getAvailableOptions', attr.name);
            //console.log('prev_selected', prev_selected);

            var item = api_data[attr.ext.sku];

            if (attr.top_level)
            {
                //debugger;
                //return attr.options;
            }

            if (!item.active_combinations)
            {
                return attr.options;
            }

            var active_combinations = item.active_combinations;

            if (attr.top_level)
            {
                active_combinations = item.top_level.active_combinations
            }

            /*if (is_kit_item)
            {
              return attr.options;
            } */

            var opt_id2name = {};
            for(var j=0; j<attr.options.length; j++)
            {
                var opt = attr.options[j];
                opt_id2name[opt.id] = opt.name;
            }


            if ('undefined' == typeof prev_selected)
            {
                prev_selected = {};
            }

            //console.log('prev_selected');
            //console.log(prev_selected);

            var opts = {};

            for(var ack in active_combinations)
            {
                if (!active_combinations.hasOwnProperty(ack))
                {
                    continue;
                }

                var ac = active_combinations[ack];

                if (!attr.ext.allow_backorder)
                {
                    if (!item.back_order_warning && !(1*ac.stock))
                    {
                        continue;
                    }
                }

                var cs = active_combinations[ack].combination;

                // check match prev selected
                var prev_selected_match = true;
                for(var ck=0; ck < cs.length; ck++)
                {
                    var c = cs[ck];

                    if (prev_selected[c.attribute_id]
                        && prev_selected[c.attribute_id] != c.attribute_option_id)
                    {
                        prev_selected_match = false;
                        break;
                    }
                }

                if (!prev_selected_match)
                {
                    continue;
                }

                for(var ck=0; ck < cs.length; ck++)
                {
                    var c = cs[ck];

                    if (c.attribute_id && c.attribute_id == attr.id)
                    {
                        var opt = {};
                        opt.id = c.attribute_option_id;
                        opt.name = opt_id2name[opt.id];
                        opt.name_initial = opt.name;

                        if (!(1*ac.stock))
                        {

                            if (1*item.back_order_warning)
                            {
                                opt.name += " - " + params.back_order_warning_message;

                                if (!attr.ext.allow_backorder)
                                {
                                    opt.disabled = true;
                                }
                            }
                            else
                            {
                                if (!attr.ext.allow_backorder)
                                {
                                    continue;
                                }
                            }

                            if (!opts[opt.id])
                            {
                                opts[opt.id] = opt;
                            }
                        }
                        else
                        {
                            opts[opt.id] = opt;
                        }

                    }
                }
            }

            var kx;
            //var opts_res = [];

            var opts_on = {};

            for(kx in opts)
            {
                if (!opts.hasOwnProperty(kx))
                {
                    continue;
                }

                //opts_res.push(opts[kx]);

                opts_on[opts[kx].id] = opts[kx];
            }

            //console.log('attr-av-opts', attr);
            //console.log(opts_res);

            //console.log('opts_on'); console.log(opts_on);

            var opts_res2 = [];

            for(var j=0;j<attr.options.length; j++)
            {
                var opt = attr.options[j];
                var opt_on = opts_on[opt.id];

                if (opt_on)
                {
                    opts_res2.push(opt_on);
                }
            }

            //console.log('getAvailableOptions-result', opts_res2);

            return opts_res2;
        }


