        function refreshOpts(box_id, attr)
        {


            var sku_current = attr.ext.sku;
            var prev_ids = inputs_before[box_id][attr.id];
            var prev_selected = {};
            var item_current = api_data[sku_current];

            var id2attr = {};

            var attrs_all = item_current.attributes;
            if (attr.top_level)
            {
                attrs_all = item_current.top_level.attributes;
            }

            for(var j=0; j< attrs_all.length; j++)
            {
                var a = attrs_all[j];
                id2attr[a.id] = a;
            }

            for(var i=0; i<prev_ids.length; i++)
            {
                var prev_attr_id = prev_ids[i].id;

                if (!id2attr[prev_attr_id])
                {
                    console.log("Can't find attr by ID: " + prev_attr_id + ", box_id: " + box_id, sku_current);
                    console.log(attr);
                }

                prev_selected[prev_attr_id] = getAttrVal(box_id, id2attr[prev_attr_id]);
            }

            var opts = getAvailableOptions(attr, prev_selected);

            var $input = getAttr(box_id, attr);

            if (!$input)
            {
                console.log("can't find input", box_id, attr);
                return;
            }

            addOptsToSelect($input, opts);
        }



        function addOptsToSelect($input, opts)
        {
            var blank = {};
            blank.id = '';
            blank.name = 'select option';
            console.log('omaremam')
            console.log('old',opts)
            let new_opts=[];
            for (let option_to_edit in opts){
                try{
                    option_to_edit=(JSON.parse(option_to_edit.name)).font_family;                     console.log(option_to_edit)
                    new_opts.push(option_to_edit);
                }
                catch (e) {
                    option_to_edit=option_to_edit.name
                }
            }
            if (new_opts.length>0){
                opts=new_opts;
            }
            console.log('new',opts)

            if (!$input.attr('data-hide'))
            {
                if (opts.length > 1 && 'first' != params.default_option_behavior)
                {
                    opts = prepend(opts, blank);
                }
            }

            //console.log(opts);


            if ($input.attr('data-top-level'))
            {
                //debugger;
            }
            //console.log('opts', opts);

            var $opts = $input.find('option');

            $opts.each(function(k, opt)
            {
                var $opt = $(opt);
                var opt_id = $opt.attr('data-option-id');

                if (!inArrayKv(opts, 'id', opt_id))
                {
                    //console.log('remove', $input.attr('name'), opt_id, $opt.text());
                    $opt.remove();
                }
            })

            for(var j=0; j < opts.length; j++)
            {
                var opt_data = opts[j];
                var opt_name = opt_data.name;
                var $opt_existing = $input.find("[data-option-id='" + opt_data.id + "']");

                if ($opt_existing.length > 0)
                {
                    if (opt_data.disabled)
                    {
                        $opt_existing.attr('disabled', 1);

                        if ($opt_existing.prop('selected'))
                        {
                            $input.val('');
                        }
                    }
                    else
                    {
                        $opt_existing.removeAttr('disabled');
                    }

                    $opt_existing.attr('data-name', opt_data.name_initial);
                    $opt_existing.text(opt_name);

                    continue;
                }

                var $opt = $('<option/>');
                $opt.text(opt_name);
                $opt.attr('data-name', opt_data.name_initial);

                var opt_id = opt_data.id + '*' + opt_data.name;

                if (!opt_data.id)
                {
                    opt_id = '';
                }

                $opt.attr('value', opt_id);
                $opt.attr('data-option-id', opt_data.id);

                // $input.attr('name'),
                //console.log('add', opt_id, opt_data.name);
                if (opt_data.disabled)
                {
                    $opt.attr('disabled', 1);
                }

                $input.append($opt);
            }

            if ($input.attr('data-top-level'))
            {
                //$input.change();
            }

        }


